import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import Logo from "../../images/budget.png";
import { Header, LogoContainer, Avatar, UserContainer, LogoutButton } from "./AppbarElements";

const Appbar = () => {
  const [user, setUser] = useState(JSON.parse(localStorage.getItem("profile")));
  const history = useNavigate();

  useEffect(() => {
    setUser(JSON.parse(localStorage.getItem("profile")));
  }, []);

  return (
    <Header>
      <LogoContainer>
        <img src={Logo} alt="Logo" />
      </LogoContainer>

      <h2 className="app-name">Expense Tracker</h2>
      <UserContainer>
      <Avatar
        alt={user?.googleUserData?.name}
        src={user?.googleUserData?.imageUrl}
      />
      <LogoutButton>LOG OUT</LogoutButton>
      </UserContainer>
    </Header>
  );
};

export default Appbar;
